import React from 'react';
import Card from './Cards';
import Sdata from './sdata';
// components ke attributes hote hai..
// console.log(Sdata[0].sname);

// function ncard(val) {
     
// }

const App = () =>(
    <>
        <h1 className="heading_style">List of top 5 Netflix series in 2021</h1>

        {Sdata.map((val,index) => {
            console.log(index)
            return (
                <Card
                    key={val.id}
                    imgsrc={val.imgsrc}
                    title={val.title}
                    sname={val.sname}
                    links={val.links}
                />
            );

        })}

    </>
);
